import React from "react";
import { Routes, Route, Navigate } from "react-router-dom"; // Use Routes and Navigate instead of Switch and Redirect

// components
import AdminNavbar from "components/Navbars/AdminNavbar.js";
import Sidebar from "components/Sidebar/Sidebar.js";
import HeaderStats from "components/Headers/HeaderStats.js";
import FooterAdmin from "components/Footers/FooterAdmin.js";

// views
import Dashboard from "views/admin/Dashboard.js";
import Maps from "views/admin/Maps.js";
import Settings from "views/admin/Settings.js";
import Tables from "views/admin/Tables.js";

export default function Admin() {
  return (
    <>
      <Sidebar />
      <div className="relative md:ml-64 bg-blueGray-100">
        <AdminNavbar />
        {/* Header */}
        <HeaderStats />
        <div className="px-4 md:px-10 mx-auto w-full -m-24">
          <Routes> {/* Change from Switch to Routes */}
            <Route path="/admin/dashboard" element={<Dashboard />} /> {/* Use element prop */}
            <Route path="/admin/maps" element={<Maps />} /> {/* Use element prop */}
            <Route path="/admin/settings" element={<Settings />} /> {/* Use element prop */}
            <Route path="/admin/tables" element={<Tables />} /> {/* Use element prop */}
            <Route path="/admin" element={<Navigate to="/admin/dashboard" />} /> {/* Use Navigate for redirect */}
          </Routes>
          <FooterAdmin />
        </div>
      </div>
    </>
  );
}
